import React, { useState, useEffect } from 'react';
import '../styles/clubs.css';

function Clubs() {
  const [teams, setTeams] = useState({});

  useEffect(() => {
    fetch('http://127.0.0.1:5000/teams')
      .then(response => response.json())
      .then(data => {
        console.log('Fetched data:', data); // Add this line to debug the fetched data
        setTeams(data);
      })
      .catch(error => console.error('Error:', error));
  }, []);

  return (
    <div className="clubs-container">
      <header className="header">

      </header>
      <div className="teams-grid">
        {Object.entries(teams).map(([league, teamsList]) => (
          <React.Fragment key={league}>
            <h2>{league}</h2>
            <div className="teams-row">
              {Array.isArray(teamsList) ? (
                teamsList.map(team => (
                  <div className="team-card" key={team.id}>
                    <h3>{team.name}</h3>
                    <p>{team.country}</p>
                  </div>
                ))
              ) : (
                <p>Error: teamsList is not an array</p>
              )}
            </div>
          </React.Fragment>
        ))}
      </div>
    </div>
  );
}

export default Clubs;
